  <div class="content">
    <div class="sidebar-left">
<div class="no-bg">
<p><a class="noborder" href="/kandydaci/dlaczego-wsb"><img alt="Dlaczego powinieneś wybrać WSB" class="title-image" src="/sites/default/files/default_images/aktualnosci/2017/dlaczego_powinienes.png" style="border: 0px solid; width: 309px; height: 52px;" title="Dlaczego powinieneś wybrać WSB" /></a></p>
<p>		<a href="/kandydaci/dlaczego-wsb"><img alt="9na10.jpg" class="noborder" src="/sites/default/files/default_images/infografiki/2017/strona_glowna.png" style="width: 300px; height: 94px;" /></a></p>
<p> Studia to idealny czas na rozwijanie zainteresowań<br />
			i osobiste osiągnięcia. To niezapomniane momenty sukcesów dodających skrzydeł, pomyłek uczących pokory<br />
			i szukania nowych dróg. To czas zawierania przyjaźni<br />
			i budowania karier zawodowych. Wyższe Szkoły Bankowe od 23 lat są miejscem takich doświadczeń. Przez ten czas ponad 300 000 studentów poznało nowych przyjaciół, miało okazję do uczenia się od innych, spotkało się<br />
			z doświadczonymi praktykami i sprawdziło zdobyte umiejętności bezpośrednio w pracy.<br /><a class="see-more-link" href="/kandydaci/dlaczego-wsb">Zobacz dlaczego warto studiować w WSB</a></p>
</div>
</div>
<p> </p>
  </div>

</div><!-- /.block -->
<div id="block-block-4" class="block block-block even">

      
  <div class="content">
    <p><a class="noborder" href="/kandydaci/dlaczego-wsb"><img alt="85% studentów łączy studia i pracę" class="title-image" src="/sites/default/files/default_images/button/nagl_85_studiuje_pracuje_0.png" title="85%_studiuje_pracuje" /></a></p>
<p>		Jaki jest najlepszy sposób na bezrobocie absolwenckie? Rozpoczęcie pracy zawodowej już na studiach! Z roku na rok coraz więcej studentów WSB korzysta z tego pomysłu.</p>
<p><a href="/kandydaci/dlaczego-wsb" target="_self"><img alt="Studiuję, pracuję, zyskuję" class="noborder" src="/sites/default/files/default_images/infografiki/2016/studiuj_pracuj_0.png" /></a></p>
<p>			Odsetek studentów studiów I stopnia w WSB pracujących podczas studiów według badań prowadzonych przez TEB Akademia Sp. z o.o. w kolejnych latach.<br /><a class="see-more-link" href="/kandydaci/dlaczego-wsb">Dowiedz się więcej</a></p>

  </div>

